-- Local test migration.
-- This will be run on development environments. It should mirror what you
-- intend to apply on production, but do not include any sensitive data.

-- Create a temporary table to hold the new column data and the identifying info.
CREATE TEMP TABLE temp_tspp_new_data
(
	id                       uuid    not null,
	performance_period_start date    not null,
	tdl_id                   uuid    not null,
	quartile                 integer not null,
	rank                     integer not null,
	survey_score             numeric not null,
	rate_score               numeric not null,
	CONSTRAINT temp_tspp_new_data_pkey PRIMARY KEY (id)
);

-- Load the new column data into the temporary table.

-- Add an index on our search criteria.
CREATE INDEX ON temp_tspp_new_data (performance_period_start, tdl_id);

-- Update the special Truss TSPP record separately (it appears to have an unknown generated UUID).
UPDATE transportation_service_provider_performances
SET quartile     = 1,
	rank         = 1,
	survey_score = 70,
	rate_score   = 30
WHERE performance_period_start = '2018-01-01'
  AND transportation_service_provider_id = 'd7c0e4e0-ddcf-47b8-bdfd-6c0bce555b28'
  AND traffic_distribution_list_id = '4a8e3a96-265b-4150-900e-f86eedb38b47';

-- Loop through the temp table by performance_period_start and TDL and set the corresponding data on the TSPP table.
-- Doing this in chunks to try to speed up the process, with the most recent dates last (for shortest locks).
DO
$do$
	DECLARE
		current_start  date;
		current_tdl_id UUID;
	BEGIN
		FOR current_start, current_tdl_id IN SELECT DISTINCT performance_period_start, tdl_id
											 FROM temp_tspp_new_data
											 ORDER BY performance_period_start, tdl_id
			LOOP
				UPDATE transportation_service_provider_performances tspp
				SET quartile     = new.quartile,
					rank         = new.rank,
					survey_score = new.survey_score,
					rate_score   = new.rate_score,
					updated_at   = now()
				FROM temp_tspp_new_data new
				WHERE new.performance_period_start = current_start
				  AND new.tdl_id = current_tdl_id
				  AND tspp.id = new.id;
			END LOOP;
	END
$do$;

-- Clean up the temporary table (should happen at end of session anyway).
DROP TABLE temp_tspp_new_data;
